import logo from './logo.svg';
import './App.css';
import React from "react";

// Import all views
import Home from "./Views/Home";

function App() {
  return (
      <div>
        <NavigationBar/>
        <Router>
          <Switch>
            <Route exact path="/" component={Home}/>

          </Switch>
        </Router>
        <Footer/>
      </div>
  );
}

export default App;
